pragma solidity ^0.5.16;

import "./Interfaces/IBorrowerOperations.sol";
import "./Interfaces/ICDPManager.sol";
import "./Interfaces/IPoolManager.sol";
// import "@openzeppelin/contracts/math/SafeMath.sol";
// import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./SafeMath.sol";
import "./Ownable.sol";
import "./console.sol";


// Proxy contract for testing Liquity system properties via the Echidna fuzzing tool
contract EchidnaProxy is Ownable {

    event BorrowerOperationsAddressChanged(address _newBorrowerOperationsAddress);
    event PoolManagerAddressChanged(address _newPoolManagerAddress);
    event CDPManagerAddressChanged(address _newCDPManagerAddress);
    
    IBorrowerOperations borrowerOperations;
    address public borrowerOperationsAddress;

    IPoolManager poolManager;
    address public poolManagerAddress;

    ICDPManager cdpManager;
    address public cdpManagerAddress;

    // --- Setters ---
    function setCDPManager(address _cdpManagerAddress) public onlyOwner {
        cdpManagerAddress = _cdpManagerAddress;
        cdpManager = ICDPManager(_cdpManagerAddress);
        emit CDPManagerAddressChanged(_cdpManagerAddress);
    }

    function setPoolManager(address payable _poolManagerAddress) public onlyOwner {
        poolManagerAddress = _poolManagerAddress;
        poolManager = IPoolManager(_poolManagerAddress);
        emit PoolManagerAddressChanged(_poolManagerAddress);
    }

    function setBorrowerOperations(address _borrowerOperationsAddress) public onlyOwner {
        borrowerOperationsAddress = _borrowerOperationsAddress;
        borrowerOperations = IBorrowerOperations(_borrowerOperationsAddress);
        emit BorrowerOperationsAddressChanged(_borrowerOperationsAddress);
    }

    // --- Basic Liquity property checks ---

    // check TCR number
    // function echidna_MCRConstantGreaterThan150() public returns (bool) {
    //     return (cdpManager.MCR() > 110000000000000000000);
    // }

    // // check MCR constant in CDPManager
    // function echidna_CCRConstantGreaterThan150() public returns(bool){
    //     return (cdpManager.CCR() >  150000000000000000000); 
    // }

    // // check 'Min coll in USD' constant in BorrowerOperations
    // function echidna_MIN_COLL_IN_USD_GreaterThan20() public returns(bool){
    //     return (borrowerOperations.MIN_COLL_IN_USD() >  20000000000000000000);
    // }

    function echidna_alwaysTrue() public view returns(bool){
        return true;
    }

       function echidna_alwaysFalse() public view returns(bool){
        return false;
    }
}
